import React from "react";
import Link from "next/link";
import "./style.css";

const Navbar = () => (
  <div class="navbar">
    <Link href="/Input">
      <a class="active" href="#">
        Input to MongoDB Database
      </a>
    </Link>

    <Link href="/Retrieve">
      <a class="active" href="#">
        Retrieve from MongoDB Database
      </a>
    </Link>
  </div>
);

export default Navbar;
